import React from 'react'
import axios from "axios";
import { useEffect } from 'react';
import { useState } from 'react';

export default function ListesAnnonces({token}) {
     
    const [annonces, setannonces] = useState("");

    useEffect(() => {
        const authorization = {
            headers:{
                Authorization :   `Bearer ${token}`,
            },
        };
        axios.get("/annonce/getAnnonceUser",authorization)
        .then((reponse)=>{setannonces(reponse.data);console.log(reponse.data);})
        .catch((erreur)=>{console.log(erreur)});
        console.log("oui");
    }, []);

  return (
    <div>
      
        {
            annonces.map((annonces)=>{
                return(
                <div key={annonces._id}>
                    <p>{annonces.nom}</p>
                    <p>{annonces.prix}</p>
                    <p>{annonces.description}</p>
                    <p>{annonces.photo}</p>
                    <p>{annonces.qteDispo}</p>
                </div>
                
                )  
        })}
        
    </div>
  )
}
